import React from "react";
import "../../../Styles/Pages/Career/JobsCard.scss";

function JobsCard({ img, title, positions }) {
  return (
    <div className='jobsCard'>
      <div className='homeSecond__line jobs'></div>
      <img src={img} alt='' />
      <h4>{title}</h4>
      <p>{positions}</p>
    </div>
  );
}

export default JobsCard;
